import React from 'react';
import styled from 'styled-components';

function TagListItem({ key, content, color, imgUrl }) {
	return (
		<Button color={color} type="button">
			{content}
			<img src={imgUrl} alt={content} />
		</Button>
	);
}

const Button = styled.button`
	white-space: pre;

	/* 바꿀 것 */
	background: ${(props) => props.color}
	position: relative;
	height: 32px;
	padding: 8px 14px;
	border-radius: 20px;
	display: inline-flex;
	justify-content: center;
	align-items: center;
	margin-right: 8px;
	font-size: 13px;
	line-height: 16px;
	font-weight: 400;
	color: #333;
	padding-right: 20px;
	border: 1px solid transparent;
	> img {
		width: 16px;
		height: 16px;
		margin-left: 5px;
		display: block;
	}
`;

export default TagListItem;
